import Link from "next/link";
import uniqid from "uniqid";

//TODO Filtrují se i polé které neexistujou na straně body

interface IProps {
  clients: any;
  reverse: boolean;
  sort: string;
  fields: any;
}

const TableBody = ({ clients, reverse, sort, fields}: IProps) => {
  reverse
    ? clients.sort((a: any, b: any) => (b[sort] > a[sort] ? 1 : -1))
    : clients.sort((a: any, b: any) => (b[sort] > a[sort] ? -1 : 1));

  const fieldNames = [];
  fields.forEach((e : any) => fieldNames.push(e.fieldName));

  const tableClients = clients.map((e: any) => {
    const tableItem = () => {
      let items = [];
      for (let key in e) {
        //show only existing fields clients data
        if (e[key] !== e._id && fieldNames.includes(key)) {
          items.push(
          <td key={uniqid()}>

          {e[key]}
          </td>
          )
        }
      }
      return items;
    };

    return (
      <tr key={e._id}>
        <td><input type="checkbox" name={e._id} id={e._id}/></td>
        {tableItem()}
        <td>
          <Link href="/clients/[id]" as={`/clients/${e._id}`}>
            <a>Go to client</a>
          </Link>
        </td>
      </tr>
    );
  });
  return tableClients;
};

export default TableBody;
